import React from "react";
import { Link } from "react-router-dom";
import './header.css';

function Header() {
  return (
      <header>
        <nav>
          <ul>
            <ul className="menuul">
            <li><Link to="/">Home</Link></li>
            <li><Link to="/signup">Sign up</Link></li>
            <li><Link to="/signin">Sign in</Link></li>
            </ul>
          </ul>
        </nav>
        <h1>Vibrato Music</h1>

        <h2>
          A place to have all your favorite music in one spot
        </h2>

      </header>
    );
}

function About() {
  return (
<section className="about" >
                <h2>Why use Vibrato Music</h2>
              <p>
                  Vibrato Music is an app to not only store  your favorite music but also allows you to add more songs from random websites. 
              </p>
            </section>
  )
}
